ption\":{\"edges\":[{\"node\":{\"text\":\"Today
        is Earth Day! \\nHave you ever stopped to realize how lucky we are to live
        in on this magical planet? This beautiful blue dot floating in space is our
        home and we need to take care of it. Plastic has become a serious issue in
        our world. It\\u2019s polluting our land, our beaches, rivers, oceans, killing
        our marine life. It\\u2019s affecting the health of all of us! How can we
        change that? Please take a moment to reflect on how our actions affect our
        environment. After all, it\\u2019s our home we are talking about. Each one
        of us can take small steps to reduce plastic consumption and waste. Learn
        how: https://www.earthday.org/earthday #Earthday #beatplasticpollution #BeatPollution
        \\ud83d\\udc99\\ud83d\\ude4f\\ud83c\\udf0e \\u267b\\ufe0f Hoje \\u00e9 o Dia
        da Terra!\\nVoc\\u00ea j\\u00e1 parou para pensar na sorte que temos em viver
        neste planeta m\\u00e1gico? Este belo ponto azul flutuando no espa\\u00e7o
